m; // I'm also using this for all code blocks\n$font-size__text: 1rem;\n$font-size__text__code: 0.9em;\n$font-size__small: 0.933rem;\n\n$headline-font-size__xxxs: 1rem; // Sublines\n$headline-font-size__xxs: 1.2rem; // H6\n$headline-font-size__xs: 1.3rem; // H5\n$headline-font-size__s: 1.3rem; // H4\n$headline-font-size__m: 1.6rem; // H3\n$headline-font-size__l: 1.8rem; // H2\n$headline-font-size__ll: 2.1rem; // H2\n$headline-font-size__xl: 2.533rem; // H1\n$headline-font-size__xxl: 3.2rem; // Hero headline\n$headline-font-size__xxxl: 3.2rem; // Landing page hero headline\n\n// Font Families\n// ------------------------------------------------\n\n$font__default: \"Satoshi Variable\", sans-serif;\n// 🍔 TODO add DM sans as body copy font\n$font__code: \"PT Mono\", monospace;\n\n// Spacing\n// ------------------------------------------------\n\n$spacing__base: 0.5rem; // 8px\n\n$spacing__xxs: calc($spacing__base/ 4); // 2px\n$spacing__xs: calc($spacing__base/ 2); // 4px\n$spacing__s: $spacing__base; // 8px\n$spacing__m: calc($spacing__base * 2); // 16px\n$spacing__l: calc($spacing__base * 3); // 24px\n$spacing__xl: calc($spacing__base * 4); // 32px\n$spacing__xxl: calc($spacing__base * 8); // 64px\n$spacing__xxxl: calc($spacing__base * 10); // 80px\n\n// Breakpoints\n// ------------------------------------------------\n\n$breakpoint__xxs: 450px;\n$breakpoint__xs: 600px;\n$breakpoint__s: 750px;\n$breakpoint__m: 960px;\n$breakpoint__l: 1280px;\n$breakpoint__xl: 1920px;\n\n// Layout\n// ------------------------------------------------\n\n$layout__max-width: 1100px;\n$report__max-width: 900px;\n$contest__max-width: 1100px;\n$form__max-width: 900px;\n$newsletter-signup__max-width: 900px;\n\n// Shadows\n// ------------------------------------------------\n\n$shadow__base: 0 0 0.5rem 0 rgba(0, 0, 0, 0.5);\n$shadow__hover: 0 0 0.5rem 0 rgba(0, 0, 0, 0.75);\n\n// Border radius\n// ------------------------------------------------\n\n$border-radius__base: 0.2rem; // 4px\n$border-